  true,\n\t\"url\": null,\n\t\"notes\": \"The National Renewable Energy Laboratory
  (NREL) publishes a wide selection of data and statistics on energy power technologies
  from a variety of sources (e.g. Energy Information Administration, Oak Ridge National
  Laboratory, Sandia National Laboratory, and EPRI). In 2006, NREL published the 4th
  edition, presenting, among other things, _data on U.S. electricity capability_.
  \ The series of datasets included are:  electric power sector net summer capability
  (1980 - 2030), for coal, petroleum/natural gas, nuclear,  and renewables (also included,
  similar estimates for electricity-only plants and combined-heat-and-power plants);
  regional noncoincident peak loads (1990 - 2004); electric generator cumulative additions
  and retirements (2010 - 2030); and transmission and distribution circuit miles (1980
  - 2004).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
